import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: 'e1', title: "Event 1" },
  { id: 'e2', title: "Event 2" },
  { id: 'e3', title: "Event 3" },
];

export const EventsPage = () => {
  return (
    <>
      <h1>Events</h1>
      <ul>
        {DUMMY_EVENTS.map((ev) => (
          <li key={ev.id}>
            <Link to={ev.id}>{ev.id}</Link>
          </li>
        ))}
      </ul>
      <button><Link to='/events/new'>{}</Link></button>
    </>
  );
};
